class Solution {
public:
    struct VectorHash {
        size_t operator()(const std::vector<int> &v) const {
            std::hash<int> hasher;
            size_t seed = 0;
            for (int i : v) {
                seed ^= hasher(i) + 0x9e3779b9 + (seed << 6) + (seed >> 2);
            }
            return seed;
        }
    };

    vector<vector<int>>
    highestRankedKItems(vector<vector<int>> &grid, vector<int> &pricing, vector<int> &start, int k) {
        vector<vector<int>> res;
        vector<vector<int>> ans;
        int m = grid.size();
        int n = grid[0].size();
        // unordered_map<vector<int>, int, VectorHash> ma;
        vector<vector<int>> ma(m, vector<int>(n, -1));
        queue<vector<int>> qu;
        qu.push(start);
        vector<vector<int>> dis = {{0,  1},
                                   {1,  0},
                                   {0,  -1},
                                   {-1, 0}};
        ma[start[0]][start[1]] = 0;
        if (grid[start[0]][start[1]] >= pricing[0] and grid[start[0]][start[1]] <= pricing[1]) {
            res.push_back(start);
        }
        while (!qu.empty()) {
            vector<int> tmp = qu.front();
            qu.pop();
            int step = ma[tmp[0]][tmp[1]];
            int i = tmp[0], j = tmp[1];
            for (auto it: dis) {
                int xx = i + it[0];
                int yy = j + it[1];
                if (i + it[0] >= 0 and i + it[0] < m and j + it[1] >= 0 and j + it[1] < n and
                    ma[i + it[0]][j + it[1]] == -1 and grid[i + it[0]][j + it[1]] != 0) {
                    // vector<int> t = {i + it[0], j + it[1]};
                    ma[i + it[0]][j + it[1]] = step + 1;
                    qu.push({i + it[0], j + it[1]});
                    if (grid[i + it[0]][j + it[1]] >= pricing[0] and grid[i + it[0]][j + it[1]] <= pricing[1]) {
                        res.push_back({i + it[0], j + it[1]});
                        // res.push_back({step + 1 ,grid[i + it[0]][j + it[1]], i + it[0], j + it[1]});
                    }
                }
            }
        }

        int max_ = min(k + 8, (int) res.size());


        // sort(res.begin(), res.end());
        // for (int i = 0; i < k + 8 and i < _size(); ++i) {
        //     int t = i;
        //     while (i + 1 < k + 8 and i + 1 < _size and ma[res[i][0]][res[i][1]] < ma[res[i + 1][0]][res[i + 1][1]]) {
        //         i++;
        //     }
        sort(res.begin() + t, res.begin() + i, [&](vector<int> &a, vector<int> &b) {
            if (ma[a[0]][a[1]] < ma[b[0]][b[1]]) {
                return true;
            } else if (ma[a[0]][a[1]] == ma[b[0]][b[1]] and grid[a[0]][a[1]] < grid[b[0]][b[1]]) {
                return true;
            } else if (ma[a[0]][a[1]] == ma[b[0]][b[1]] and grid[a[0]][a[1]] == grid[b[0]][b[1]] and a[0] < b[0]) {
                return true;
            } else if (ma[a[0]][a[1]] == ma[b[0]][b[1]] and grid[a[0]][a[1]] == grid[b[0]][b[1]] and
                       a[0] == b[0] and a[1] < b[1]) {
                return true;
            } else {
                return false;
            }
        });
        //     i--;
        // }
        vector<vector<int>> ans;
        for (int i = 0; i < res.size() && i < k; i++) ans.push_back({res[i][2], res[i][3]});
        return ans;
        // printf("%d", res.size());
        // max_ = min(k, (int) res.size());
        // return vector<vector<int>>(res.begin(), res.begin() + max_);
    }
};

